from operator import itemgetter
class Solution:
    def minCost(self, nums, cost):
        table={}
        for i in range(len(nums)-1):
            for j in range(i+1,len(nums)):
                if i not in table:
                    table[i]=abs(nums[j]-nums[i])*cost[j]
                else:
                    table[i]+=abs(nums[j]-nums[i])*cost[j]
                if j not in table:
                    table[j]=abs(nums[j]-nums[i])*cost[i]
                else:
                    table[j]+=abs(nums[j]-nums[i])*cost[i]
        print(table)
        ans=float('inf')
        for i in table:
            ans=min(table[i],ans)
        
        
        
        return ans
    
